// Inside a.aspx.cs (code-behind file)\nprotected void Page_Load(object sender, EventArgs e)\n{\n    StringWriter stringWriter = new StringWriter();\n    HtmlTextWriter htmlWriter = new HtmlTextWriter(stringWriter);\n    \n    Server.Execute("b.aspx", htmlWriter);\n    \n    // Assuming you have a div with ID 'contentDiv' in your a.aspx\n    contentDiv.InnerHtml = stringWriter.ToString();\n}